import React from 'react';
import Layout from './Layout';
import { Switch, Route } from 'react-router-dom'
import Auth from './Auth'

class App extends Component {
  render(){
  return (
    <Layout>
      <Switch>
        <Route exact path="/auth" component={Auth} />
      </Switch>
    </Layout>
  );
}
}

export default App;
